import React from 'react'



const Nation = (props) => (
        <div>
            Test
            {props.bpi.address_components[1]}
        </div>
);

Nation.getInitialProps = async function() {
    const res = await fetch(`https://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyD8g2ang82_R7aQG8AdVAJg4jkQ52-cp4E`);
    const data = await res.json();
  
    return {
      bpi: data
    };
  }
  

export default Nation;
